import React, { useEffect, useState } from 'react';
import * as tw from '../css/NewsList.tw';

interface NewsItem {
  headline_ko: string;
  summary_ko: string;
  url: string;
}

const NewsList: React.FC = () => {
  const [news, setNews] = useState<NewsItem[]>([]);

  useEffect(() => {
    fetch('/api/news')
      .then(res => res.json())
      .then(data => setNews(
        (data.news || []).filter((item: any) => item.headline_ko && item.summary_ko)
      ));
  }, []);

  return (
    <div className={tw.container}>
      {news.map(item => (
        <div className={tw.newsItem} key={item.url}>
          <a href={item.url} target="_blank" rel="noopener noreferrer" className={tw.headline}>
            {item.headline_ko}
          </a>
          <p className={tw.summary}>{item.summary_ko}</p>
        </div>
      ))}
    </div>
  );
};

export default NewsList;
